import React from "react";
import location from "../../image/location.png";
import vk from "../../image/vk.png";
import tg from "../../image/telegram.png";
import yuo from "../../image/youtube.png";
import prof from "../../image/profile.png";
import "./preview.css";
function Preview() {
  return (
    <div className="bg">
      <div className="container">
        <div className="preview">
          <div className="preview__location">
            <img src={location} alt="404" />
            <span>Днепр</span>
          </div>
          <ul className="preview_list">
            <li>Доставка</li>
            <li>Гарантия</li>
            <li>Пункты выдачи на карте</li>
            <li>Адреса магазинов </li>
          </ul>
          <div className="preview__groups">
            <img src={tg} alt=""></img>
            <img src={vk} alt=""></img>
            <img src={yuo} alt=""></img>
          </div>
          <div className="preview__profile">
            <img src={prof} alt=""></img>
            <span>Личный кабинет</span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Preview;
